import React, { useState } from 'react';

const StartMenu = () => {
	const [start, setStart] = useState('false')

	return (
		<div>
			<h1>Sports Trivia</h1>
			<div>
				<button onClick={() => setStart(!start)}>Start</button>
			</div>
		</div>
	);
};

export default StartMenu;
